import React from "react";
import axios from "axios";
function PersonList() {
  const axios = require("axios");
  axios.get("http://127.0.0.1:8000/api/person/").then(function (respons) {
    console.log(respons.data);
    const newList = () => {
      return (
        <ul>
          {respons.map((item) => (
            <li>{item.name}</li>
          ))}
        </ul>
      );
    };
  });
  return (
    <div>
      <form action="">
        <input type="text" />
        <button>add</button>

        <hr />
        {newList}
      </form>
    </div>
  );
}

export default PersonList;
